import React from 'react';
import "./sass/filter.css";

export default function Dropdown({ placeholder }) {
    const getDisplay = () => {
        return placeholder;
    }

    return (
        <div className="dropdown">
            <div className="dropdown--input">
                <div className="dropdown-selected-value">{getDisplay()}</div>

            </div>
        </div>
    )
}
